import React, { useState } from "react";
import { Box, MenuItem, Select, InputLabel, FormControl, Button, TextField, Card, Typography } from "@mui/material";
import axios from 'axios';

function App() {
  const [inputType, setInputType] = useState("");
  const [file, setFile] = useState(null);
  const [url, setUrl] = useState("");
  const [preview, setPreview] = useState("");

  const handleInputChange = (event) => {
    setInputType(event.target.value);
    setFile(null);
    setUrl("");
    setPreview("");
  };

  const handleFileChange = (event) => {
    const selectedFile = event.target.files[0];
    setFile(selectedFile);

    if (inputType === "image") {
      const imageUrl = URL.createObjectURL(selectedFile);
      setPreview(imageUrl);
    }

    if (inputType === "txt") {
      const reader = new FileReader();
      reader.onload = () => setPreview(reader.result);
      reader.readAsText(selectedFile);
    }

    if (inputType === "pdf") {
      const reader = new FileReader();
      reader.onload = () => {
        setPreview("PDF file uploaded: " + selectedFile.name);
      };
      reader.readAsArrayBuffer(selectedFile);
    }
  };

  const handleUrlChange = (event) => {
    setUrl(event.target.value);
    setPreview(event.target.value);
  };

  const handleGenerate = async () => {
    // Your existing handleGenerate logic...
  };

  const handleCreate = () => {
    // Logic for the Create button
    alert("Create button clicked!");
  };

  return (
    <Box sx={{ padding: 4, maxWidth: 600, margin: 'auto', mt: 4 }}>
      <Card variant="outlined" sx={{ padding: 3 }}>
        <Typography variant="h4" gutterBottom>
          Import File or URL
        </Typography>

        <FormControl fullWidth sx={{ mb: 3 }}>
          <InputLabel>Select Input Type</InputLabel>
          <Select
            value={inputType}
            label="Select Input Type"
            onChange={handleInputChange}
          >
            <MenuItem value="">-- Choose One --</MenuItem>
            <MenuItem value="pdf">PDF File</MenuItem>
            <MenuItem value="url">Website URL</MenuItem>
            <MenuItem value="image">Image File (PNG, JPG, JPEG)</MenuItem>
            <MenuItem value="txt">Text File (.txt)</MenuItem>
          </Select>
        </FormControl>

        {/* Conditional rendering for URL, Image, PDF, and TXT input */}
        {inputType === "url" && (
          <Box>
            <TextField
              label="Enter Website URL"
              variant="outlined"
              fullWidth
              value={url}
              onChange={handleUrlChange}
              placeholder="https://example.com"
              sx={{ mb: 2 }}
            />
            {url && (
              <Typography>
                URL Entered: <a href={url} target="_blank" rel="noopener noreferrer">{url}</a>
              </Typography>
            )}
          </Box>
        )}

        {inputType === "image" && (
          <Box>
            <input
              accept="image/*"
              type="file"
              onChange={handleFileChange}
              style={{ margin: '10px 0' }}
            />
            {preview && <img src={preview} alt="Preview" style={{ width: '100%', height: 'auto' }} />}
          </Box>
        )}

        {inputType === "pdf" && (
          <Box>
            <input
              accept="application/pdf"
              type="file"
              onChange={handleFileChange}
              style={{ margin: '10px 0' }}
            />
            {preview && <Typography>{preview}</Typography>}
          </Box>
        )}

        {inputType === "txt" && (
          <Box>
            <input
              accept=".txt"
              type="file"
              onChange={handleFileChange}
              style={{ margin: '10px 0' }}
            />
            {preview && <Typography>File Preview: {preview}</Typography>}
          </Box>
        )}

        <Box sx={{ mt: 4 }}>
          <Button
            variant="contained"
            color="primary"
            fullWidth
            onClick={handleGenerate}
            sx={{ mb: 2 }}
          >
            Generate
          </Button>
          <Button
            variant="outlined"
            color="secondary"
            fullWidth
            onClick={handleCreate}
          >
            Create
          </Button>
        </Box>
      </Card>
    </Box>
  );
}

export default App;
